	draw_polygon = function (geohashes) {
        for (var i = 0; i < geohashes.length; i++) {
            var geohash_bounds = get_bounds(geohashes[i]);

            var triangleCoords = [
                geohash_bounds.se,
                geohash_bounds.sw,
                geohash_bounds.nw,
                geohash_bounds.ne
            ];

            // Construct the polygon.
            var bermudaTriangle = new google.maps.Polygon({
                paths: triangleCoords,
                strokeColor: '#FF0000',
                strokeOpacity: 0.8,
                strokeWeight: 2,
                fillColor: '#FF0000',
                fillOpacity: 0.35
            });
            bermudaTriangle.setMap(map);
        }
    }

        var city_name = $("#city").val();

        var data = {
            street_name: street_name,

        };
        $.ajax({

            url: "http://172.16.101.204:18080/entity/v4/debug/street/json",

            dataType: "json",
            type: "get",
            data: data,
            error: function (response) {
                alert(response);
            },
            success: function (response) {
                if (response != null) {
                    new_center = response[0].start;
                    new_zoom = map.zoom;

                    map = new google.maps.Map(document.getElementById('map'), {
                        mapTypeId: google.maps.MapTypeId.TERRAIN
                    });
                    map.setCenter(new_center);
                    map.setZoom(new_zoom);
                    draw_polyline(response);
                }
            }
        });
    }


    BASE32 = '0123456789bcdefghjkmnpqrstuvwxyz';

    get_bounds = function (geohash) {
        if (geohash.length == 0) throw new Error('Invalid geohash');

        geohash = geohash.toLowerCase();

        var evenBit = true;
        var latMin = -90, latMax = 90;
        var lonMin = -180, lonMax = 180;

        for (var i = 0; i < geohash.length; i++) {
            var chr = geohash.charAt(i);
            var idx = BASE32.indexOf(chr);
            if (idx == -1) throw new Error('Invalid geohash');

            for (var n = 4; n >= 0; n--) {
                var bitN = idx >> n & 1;
                if (evenBit) {
                    // longitude
                    var lonMid = (lonMin + lonMax) / 2;
                    if (bitN == 1) {
                        lonMin = lonMid;
                    } else {
                        lonMax = lonMid;
                    }
                } else {
                    // latitude
                    var latMid = (latMin + latMax) / 2;
                    if (bitN == 1) {
                        latMin = latMid;
                    } else {
                        latMax = latMid;
                    }
                }
                evenBit = !evenBit;
            }
        }

        var bounds = {
            sw: {lat: latMin, lng: lonMin},
            se: {lat: latMin, lng: lonMax},
            ne: {lat: latMax, lng: lonMax},
            nw: {lat: latMax, lng: lonMin}
        };

        return bounds;
    };
